import React, {useState, useCallback} from "react";
import { motion } from 'framer-motion/dist/framer-motion';
import styles from "styled-components";

import {  Title } from "../core";

import imgL from "../../assets/favicon.png";
import { Col } from "react-bootstrap";
import { Questions } from "./Questions";



const [index, setIndex] = useState(false);

const handleClose = useCallback(() => {
  setIndex(false);
}, []);



export default function App() {


    return (
      <div className='container'>
        <ul className='row p-0'>
        {Questions.map((item) => (
            <div  className=' col-12 col-lg-4 col-md-6'>
            <motion.li
              className='layoutItem p-5'
              key={item.item}
              layoutId={`${item.item}`}
              onClick={() => index === false && setIndex(item.item)}
              initial={{ borderRadius: "20px" }}
            >
              <motion.div
                className={styles.placeholder}
                layoutId={`placeholder-${item.item}`}
              >
                <div className='row align-items-center'>
                        <Col className='xs-auto col-2 p-0'>
                            <img className="" alt="Pixie" height="50" width="50" src={imgL} />   
                        </Col>
                        <div className='col-10'>
                            <Title variant="cardLg" className='mb-0'>{`${item.label}`}</Title>
                        </div>
                </div>

                <div />
                <div />
              </motion.div>
              <motion.div
                className={styles.additional}
                layoutId={`additional-${item.item}`}
              >
                <div />
                <div />
                <div />
              </motion.div>
              <motion.div
                className={styles.itemClose}
                layoutId={`close-${item.item}`}
              />
            </motion.li>
            </div>

          ))}
        </ul>

          {index !== false && (
            <>

                 <div>
              <motion.div className='modalContainer' key="modal">
                <motion.div
                  className='aniModal'
                  layoutId={`${index}`}
                  initial={{ borderRadius: "30px" }}
                >
                  <motion.div
                    className={styles.placeholder}
                    layoutId={`placeholder-${index}`}
                  >
                    <div className='col-12' >
                        <div className='row align-items-center'>
                            <Col className='xs-auto col-2'>
                                <img className="" alt="Pixie" height="50" width="50" src={imgL} />   
                            </Col>
                            <div className='col-10'>
                                <Title variant="cardLg" className='mb-0' layoutId={`${index}`}>Test</Title>
                            </div>
                        </div>
                    </div>

                    <div />
                    <div />
                  </motion.div>
                  <motion.div
                    className={styles.additional}
                    layoutId={`additional-${index}`}
                  >
                    <div />
                    <div />
                    <div />
                  </motion.div>
                  <motion.div
                    className='modalClose'
                    layoutId={`close-${index}`}
                    onClick={handleClose}
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    exit={{ opacity: 0 }}
                  >
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20">
                      <path
                        d="M15 5L5 15M5 5l5.03 5.03L15 15"
                        fill="transparent"
                        strokeWidth="2"
                        stroke="currentColor"
                        strokeLinecap="round"
                      />
                    </svg>
                  </motion.div>
                </motion.div>
              </motion.div>
              <motion.div
                className='modalBackdrop'
                key="backdrop"
                onClick={handleClose}
                variants={{
                  hidden: {
                    opacity: 0,
                    transition: {
                      duration: 0.16
                    }
                  },
                  visible: {
                    opacity: 0.8,
                    transition: {
                      delay: 0.04,
                      duration: 0.2
                    }
                  }
                }}
                initial="hidden"
                exit="hidden"
                animate="visible"
              />
              </div>

            </>
          )}

      </div>
    );
  }
